(function(){

  function serialize(node, stack) {
    var obj = {
      nodeType: node.nodeType,
      attributes: [],
      childNodes: []
    };
    var i;

    switch(node.nodeType) {
      case 1:
        obj.tagName = node.tagName;
        for(i = 0; i < node.attributes.length; i++) {
          serialize(node.attributes[i], obj.attributes);
        }
        for(i = 0; i < node.childNodes.length; i++) {
          serialize(node.childNodes[i], obj.childNodes);
        }
        break;
      case 2:
        obj = {
          nodeType: node.nodeType,
          name: node.name,
          value: node.value
        }
        break;
      case 3:
        obj = {
          nodeType: node.nodeType,
          nodeValue: node.nodeValue
        };
        break;
    }

    stack.push(obj);

    return stack;
  }

  self.stack = serialize(document.documentElement, [])

})();
